const Footer: React.FC = () => {
  return (
    <footer className="bg-white/80 backdrop-blur-sm border-t border-gray-200 mt-8">
      <div className="max-w-screen-md mx-auto px-4 sm:px-6 lg:px-8 py-6">
        <div className="text-center">
          <div className="text-xl font-bold bg-gradient-to-r from-blue-600 to-cyan-600 bg-clip-text text-transparent mb-2">
            투어 스트림
          </div>
          <p className="text-gray-500 text-xs mb-3">
            최고의 투어 경험을 제공합니다
